import React from 'react';

const SimplePage = () => {
    return (
        <header className="font-montserrat">
            <div className="container px-[76px] py-3 bg-white text-[#999999]">
                <div data-layer="Ваш город: Москва" className="left-0 top-0 absolute justify-center"><span className="text-[#999999] text-sm font-normal font-['Montserrat'] leading-normal">Ваш город: </span><span className="text-[#333333] text-sm font-medium font-['Montserrat'] leading-normal">Москва</span></div>
            </div>
        </header>
    );
};

export default SimplePage;
